import image from "./surf.JPG";
import image2 from "./jaws.jpeg"
import image3 from "./breakwall.webp"

const Gallery = () => {




    return (
        <div className="gallery">
            <img src={image} alt="Honolua Bay" />
            <h2 className="title">Honolua Bay</h2>
            <img src={image2} alt="Jaws" />
            <h2 className="title2">Jaws</h2>
            <img src={image3} alt="Lahaina Breakwall" />
            <h2 className="title3">Lahaina Breakwall</h2>
        </div>
    );
}

export default Gallery;
